import React from 'react';
import { Paper, Typography, Box } from '@mui/material';
import { Droppable, Draggable } from 'react-beautiful-dnd';
import LayerCard from './LayerCard';

const layerTypes = [
  {
    id: 'conv2d-template',
    type: 'Convolution 2D',
    icon: 'âš¡',
    defaultParams: {
      filters: 32,
      kernelSize: 3,
      stride: 1,
      padding: 1,
      activation: 'relu'
    }
  },
  {
    id: 'maxpool-template',
    type: 'Max Pooling',
    icon: 'ðŸ”²',
    defaultParams: {
      poolSize: 2,
      stride: 2
    }
  },
  {
    id: 'dropout-template',
    type: 'Dropout',
    icon: 'ðŸ’§',
    defaultParams: {
      rate: 0.25
    }
  },
  {
    id: 'dense-template',
    type: 'Fully Connected',
    icon: 'ðŸ”Œ',
    defaultParams: {
      units: 128,
      activation: 'relu'
    }
  }
];

const LayerPalette = () => {
  return (
    <Paper sx={{ p: 2, mb: 2 }}>
      <Typography variant="h6" gutterBottom>
        Available Layers
      </Typography>
      <Droppable droppableId="layerPalette" isDropDisabled={true}>
        {(provided) => (
          <Box
            ref={provided.innerRef}
            {...provided.droppableProps}
            sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}
          >
            {layerTypes.map((layer, index) => (
              <Draggable
                key={layer.id}
                draggableId={`${layer.id}-template`}
                index={index}
              >
                {(provided) => (
                  <div
                    ref={provided.innerRef}
                    {...provided.draggableProps}
                    {...provided.dragHandleProps}
                  >
                    <LayerCard layer={layer} isTemplate={true} />
                  </div>
                )}
              </Draggable>
            ))}
            {provided.placeholder}
          </Box>
        )}
      </Droppable>
    </Paper>
  );
};

export default LayerPalette;
